import { Link } from 'react-router-dom';

function NavButton({icon, text, dropdownIcon}) {
  return (
    <div>
      <a href="intro" id="introBtn" className="flex items-center px-4 py-2 text-gray-700 rounded-lg hover:bg-gray-100 hover:text-gray-700">
        {icon} {text}
      </a>
      {/* <Link to="/">Home</Link> */}
    </div>
    // <Link to="/">Home</Link>
  );
}

export default NavButton;
